import React from 'react';
import { Icon } from '@iconify/react';
import { Link } from 'react-router-dom';

const ChoosePaymentMethod = () => {
  return (
    <div className="w-96 h-fit z-100 bg-white shadow-lg p-2 pt-6 ">
		  <div className="flex flex-col justify-center p-4 mt-2">
			<p className='text-dark-gray font-semibold'>Choose Payment Method</p>
			<div className='w-full font-light text-dark-gray rounded mt-4 flex p-2 items-center justify-around border'>
				<div className='basis-1/4'>
                <Icon icon="f7:creditcard" color="#17181a" width="20" height="20" />
                </div>
				<div className='flex flex-col basis-1/2'>
                    <span className='text-sm text-dark-gray font-semibold'>Debit/creditcard</span>
                    <span className='text-sm text-dark-gray mt-1'>100.00</span>
                </div>
                <div className='flex gap-6 basis-1/4'>
                     <Icon icon="akar-icons:minus" color="#17181a" width="20" height="20" />
                     <Icon icon="ion:star-outline" color="#17181a" width="20" height="20" />
                </div>
			</div>

		  </div>
		</div>
  );
};

export default ChoosePaymentMethod;
